import React from "react";
import { exclusiveList } from "../../static/data";

function JSExclusive() {
  return (
    <div className="container">
      <div>
        <h3>Personalised Match-Making Service</h3>

        <span>
          Introducing <strong> JS Exclusive</strong>{" "}
        </span>
      </div>
      <div>
        <img className="exclusive" src="https://www.jeevansathi.com/images/jsms/photo/exclusive.png" />
      </div>

      <div>
        <ul>
          {exclusiveList.map(function({ imgURL, text }) {
            return (
              <li key={text}>
                <img src={imgURL} />
                <span>{text}</span>
              </li>
            );
          })}
        </ul>
      </div>

      <style jsx>{`
        .container {
          padding: 32px 24px;
        }

        h3 {
          font-size: 12px;
          font-weight: 700;
          color: #8a9db0;
          margin-bottom: 4px;
          letter-spacing: 1.5px;
          text-transform: uppercase;
        }
        span {
          font-size: 20px;
        }
        strong {
          color: #d9475c;
        }

        .exclusive {
          width: 100%;
          margin: 20px 0;
          max-height: 190px;
        }

        li {
          display: inline-flex;
          align-items: center;
          margin-bottom: 15px;
        }
        li img {
          margin-right: 10px;
        }
        li span {
          color: #14202b;
          font-size: 16px;
          font-weight: 500;
          line-height: 19px;
          text-align: left;
        }
      `}</style>
    </div>
  );
}

export default JSExclusive;
